// 图标列表组件
class DCIconList {
    /**
     * 创建一个图标列表组件
     * 
     * @class DCIconList
     * @constructor
     * @param {string} container - 容器元素的 CSS 选择器
     * @param {Object} content - 图标列表数据
     * @param {Object} options - 配置选项
     * @description 这个类用于在网页中创建一个可滚动的图标列表组件。它接受一个容器元素的 CSS 选择器、图标列表数据和配置选项作为参数。
     */
    constructor(container, content, options) {
        this.container = container;
        this.content = content;
        this.options = options || {};
        /**
         * 图标列表
         * @type {Object}
         */
        this.iconList = content || {};
        /**
         * 初始化组件
         * @method init
         */
        this.init();
        /**
         * 创建元素样式
         * @method createEleStyle
         */
        this.createEleStyle();
    }
    
    /**
     * 初始化图标列表组件
     * 
     * @method init
     * @description 这个方法用于初始化图标列表组件。它会调用 `renderIcons` 方法来渲染图标列表，并添加复制功能。
     */
    init() {
        this.renderIcons(this.iconList);
        this.addCopyFunctionality();
    }
    
    /**
     * 创建元素样式
     * 
     * @method createEleStyle
     * @description 这个方法用于创建元素样式。它会根据不同的屏幕宽度设置不同的样式，并将这些样式插入到文档的 `<head>` 标签中。
     */
    createEleStyle() {
        const CssRules = `
            @media screen and (min-width: 1025px) { ul, li { margin: 0; padding: 0; list-style: none; }
                .icons-container { margin: 0 auto; position: relative; display: flex; flex-direction: column; align-items: center; justify-content: center; }
                .icons-container .icon-inner { width: 100%; margin-bottom: 20px; display: flex; justify-content: flex-start; align-items: flex-start; flex-wrap: wrap; flex-direction: column; }
                .icons-container .icon-inner .icon-title { font-size: 32px; font-weight: bold; text-align: left; line-height: 1.2; color: #000; margin-top: 0; }
                .icons-container .icon-inner .icon-list { display: flex; justify-content: center; align-items: flex-start; flex-wrap: wrap; flex-direction: row; }
                .icons-container .icon-inner .icon-list .icon-item { display: flex; justify-content: space-around; flex-direction: column-reverse; align-items: center; width: 120px; height: auto; margin: 10px 6px; cursor: pointer; box-shadow: 18px 18px 30px rgba(0, 0, 0, 0.1), -18px -18px 30px white; border-radius: 10px; transition: box-shadow .2s ease-out; }
                .icons-container .icon-inner .icon-list .icon-item:hover { box-shadow: 0 0 0 rgba(0, 0, 0, 0.1), 0 0 0 white, inset 18px 18px 30px rgba(0, 0, 0, 0.1), inset -18px -18px 30px white; transition: box-shadow .2s ease-out; }
                .icons-container .icon-inner .icon-list .icon-item .icon-name { font-size: 16px; text-align: center; line-height: 1.2; color: #000; margin: 8px auto; }
                .icons-container .icon-inner .icon-list .icon-item .icon-box { width: 100%; height: 80px; display: flex; align-items: center; justify-content: center; position: relative; }
                .icons-container .icon-inner .icon-list .icon-item .icon-box svg { display: block; width: 42px; transition: width .2s ease-out; }
                .icons-container .icon-inner .icon-list .icon-item .icon-box svg path { fill: #000; } 
            }

            @media screen and (max-width: 1024px) { ul, li { margin: 0; padding: 0; list-style: none; }
                .icons-container { margin: 0 auto; position: relative; display: flex; flex-direction: column; align-items: center; justify-content: center; }
                .icons-container .icon-inner { width: 100%; margin-bottom: 20px; display: flex; justify-content: flex-start; align-items: flex-start; flex-wrap: wrap; flex-direction: column; }
                .icons-container .icon-inner .icon-title { font-size: 32px; font-weight: bold; text-align: left; line-height: 1.2; color: #000; margin-top: 0; margin-bottom: 10px; }
                .icons-container .icon-inner .icon-list { display: flex; justify-content: center; align-items: flex-start; flex-wrap: wrap; flex-direction: row; }
                .icons-container .icon-inner .icon-list .icon-item { display: flex; justify-content: space-around; flex-direction: column-reverse; align-items: center; width: 106px; height: auto; margin: 8px 6px; cursor: pointer; box-shadow: 18px 18px 30px rgba(0, 0, 0, 0.1), -18px -18px 30px white; border-radius: 10px; transition: box-shadow .2s ease-out; }
                .icons-container .icon-inner .icon-list .icon-item:hover { box-shadow: 0 0 0 rgba(0, 0, 0, 0.1), 0 0 0 white, inset 18px 18px 30px rgba(0, 0, 0, 0.1), inset -18px -18px 30px white; transition: box-shadow .2s ease-out; }
                .icons-container .icon-inner .icon-list .icon-item .icon-name { font-size: 16px; text-align: center; line-height: 1.2; color: #000; margin: 8px auto; }
                .icons-container .icon-inner .icon-list .icon-item .icon-box { width: 100%; height: 80px; display: flex; align-items: center; justify-content: center; position: relative; }
                .icons-container .icon-inner .icon-list .icon-item .icon-box svg { display: block; width: 42px; transition: width .2s ease-out; }
                .icons-container .icon-inner .icon-list .icon-item .icon-box svg path { fill: #000; } 
            }
        `;
        /**
         * 插入<style>标签样式到<title>标签前
         * @param {string} eleStyleInit - 样式字符串
         * 
        */
        const addStyle = (eleStyleInit) => {
        const fa = document.querySelector('title');
        const eleStyle = document.createElement('style');
        eleStyle.innerHTML = eleStyleInit;
        document.head.insertBefore(eleStyle, fa);
        };
        addStyle(CssRules);
    }

    /**
     * 渲染图标列表
     * 
     * @method renderIcons
     * @param {Object} data - 包含图标的数据对象
     * @description 这个方法用于在指定的容器中渲染图标列表。它会遍历传入的数据对象，为每个图标类别创建一个包含标题和图标的列表项，并将这些列表项添加到指定的容器中。
     */
    renderIcons(data) {
        const iconsContainer = document.createElement('div');
        iconsContainer.setAttribute('id', 'iconsContainer');
        iconsContainer.setAttribute('class', 'icons-container');
        
        let targetContainer;
        if (this.container) {
            targetContainer = document.querySelector(this.container);
            if (!targetContainer) {
                throw new Error(`指定的容器 ${this.container} 不存在`);
            }
        } else {
            targetContainer = document.body;
        }
        
        targetContainer.appendChild(iconsContainer);

        for (const category in data) {
            if (data.hasOwnProperty(category)) {
                const categoryElement = document.createElement('div');
                categoryElement.className = 'icon-inner';
                const heading = document.createElement('h2');
                heading.className = 'icon-title';
                heading.textContent = category;
                categoryElement.appendChild(heading);
                const list = document.createElement('ul');
                list.className = 'icon-list';
                data[category].forEach(icon => {
                    const listItem = this.createIconItem(icon);
                    list.appendChild(listItem);
                });
                categoryElement.appendChild(list);
                iconsContainer.appendChild(categoryElement);
            }
        }
    }
    /**
     * 创建一个图标列表项
     * 
     * @method createIconItem
     * @param {Object} icon - 包含图标的数据对象
     * @returns {HTMLLIElement} - 创建的图标列表项元素
     * @description 这个方法用于根据传入的图标数据对象创建一个包含图标的列表项。它会创建一个 `<li>` 元素，并为其添加一个标题和一个包含图标的 `<div>` 元素。
     */
    createIconItem(icon) {
        const listItem = document.createElement('li');
        listItem.className = 'icon-item';
        const title = document.createElement('h3');
        title.className = 'icon-name';
        title.textContent = icon.description;
        listItem.appendChild(title);
        const iconDiv = document.createElement('div');
        iconDiv.className = 'icon-box';
        iconDiv.innerHTML = icon.url;
        listItem.appendChild(iconDiv);
        return listItem;
    }
    /**
     * 为图标列表中的每个图标项添加复制功能
     * 
     * @method addCopyFunctionality
     * @description 这个方法会遍历所有的图标项，并为它们添加一个点击事件监听器。当图标项被点击时，它会获取图标的 SVG 代码，并将其复制到剪贴板。如果复制成功，会弹出一个提示框告知用户；如果复制失败，会在控制台中输出错误信息。
     */
    addCopyFunctionality() {
        document.querySelector('#iconsContainer').addEventListener('click', (event) => {
            const iconItem = event.target.closest('.icon-item');
            if (iconItem) {
                const svgCode = iconItem.querySelector('.icon-box').innerHTML;
                navigator.clipboard.writeText(svgCode).then(() => {
                    alert('SVG 代码已复制到剪切板！');
                }).catch(err => {
                    console.error('复制失败:', err);
                });
            }
        });
    }
    
    /**
     * 添加新的图标类别或图标到图标列表中
     * 
     * @method addIcon
     * @param {string} category - 图标的类别
     * @param {Array} icons - 要添加的图标数组
     * @description 这个方法用于向图标列表中添加新的图标类别或图标。如果指定的类别已经存在，它会将新的图标添加到该类别的列表中；如果类别不存在，它会创建一个新的类别并将图标添加到该类别中。
     */
    addIcon(category, icons) {
        if (!this.iconList[category]) {
            this.iconList[category] = [];
        }
        this.iconList[category].push(...icons);

        const iconsContainer = document.querySelector('#iconsContainer');
        if (iconsContainer) {
            const categoryElement = Array.from(iconsContainer.querySelectorAll('.icon-container')).find(element => {
                return element.querySelector('.icon-title').textContent === category;
            });

            if (categoryElement) {
                const list = categoryElement.querySelector('.icon-list');
                icons.forEach(icon => {
                    const listItem = this.createIconItem(icon);
                    list.appendChild(listItem);
                });
            } else {
                // 创建新的类别容器并添加到 #iconsContainer
                const newCategoryElement = document.createElement('div');
                newCategoryElement.className = 'icon-inner';
                const heading = document.createElement('h2');
                heading.className = 'icon-title';
                heading.textContent = category;
                newCategoryElement.appendChild(heading);
                const list = document.createElement('ul');
                list.className = 'icon-list';
                icons.forEach(icon => {
                    const listItem = this.createIconItem(icon);
                    list.appendChild(listItem);
                });
                newCategoryElement.appendChild(list);
                iconsContainer.appendChild(newCategoryElement);
            }
        } else {
            this.renderIcons({ [category]: icons });
        }
    }
}


